        <div>
          <GerenPacientes />
        </div>
        <div>
          <ProntuarioElect />
        </div>
        <div>
          <GerenClinic />
        </div>
        <div>
          <Graficos />
        </div>
        <div>
          <Financeiro />
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
